import React, { Component } from 'react';

export default class Api extends Component {
    constructor(props) {
        super(props);
        this.url = 'https://randomuser.me/api/?results=10';
        this.getData(this.url);
    }

    async getData(url) {
        fetch(url)
            .then(data => data.json())
            .then(res => console.log(res))
            .catch(error => console.log(error));
    }

    render() {
        return <div></div>;
    }
}
